import React from 'react'
import Styles from './NavBtn.module.css'

export default function NavBtn(props) {
    changeMode = (e)=>{
        props.cM(e.target.value)
    }
    return (
        
        <li className={Styles.navBtn}>
            
            <button className={Styles.text}
                onClick={this.changeMode}
                value={props.name}>
                {props.name}
            </button>
          
        </li>
            
        
    )
}
